import React from "react";
import { NavLink } from "react-router-dom";
import youtube from "https://www.youtube.com/channel/UCXCGn3uNgLE3Fsnk7A2sDHA";

const Medialink =() =>{
    return(
    <>
         <section className="w-100 bg-light  text-center py-4">
                      <div className="link_title ">
                        <h2 className=" font-weight-bold">Follow Us On</h2>
                      </div>
                      <div className="right_sub__div d-flex justify-content-center align-items-center ">
                        <NavLink to=""><i className="fab fa-facebook-square fa-4x" ></i></NavLink>
                        <NavLink to="#"><i className="fab fa-instagram fa-4x" ></i></NavLink>
                        <NavLink to="#"><i className="fab fa-github-square fa-4x" ></i></NavLink>
                        <NavLink to={youtube} target="_blank"><i className="fab fa-youtube-square fa-4x" ></i></NavLink>
                        <NavLink to="#"><i className="fab fa-linkedin fa-4x" ></i></NavLink>
                      </div>
         </section>
    </>)
}


export default Medialink;
